import { Col, Row, Modal, Button } from "react-bootstrap";


function Delete() {
    return (
        <Modal
                    size="md"
                    scrollable
                    show={showDelete}
                    onHide={() => setShowDelete(false)}
                    id={`#skil-${skillID}`}
                  >
                    <Modal.Header closeButton>
                      <Modal.Title>
                        <Heading
                          content="Delete Skill"
                          design="h4 my-auto"
                        />
                      </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                      <p>Are you sure want to delete it?</p>{skill}
                    </Modal.Body>
                    <Modal.Footer>
                      <Button
                        variant="secondary"
                        onClick={() => setShowDelete(false)}
                      >
                        Close
                      </Button>
                      <Button
                        type="submit"
                        variant="primary"
                        value={skillID}
                        onClick={deleteSkill}
                      >
                        Save Changes {skillID}
                      </Button>
                    </Modal.Footer>
                  </Modal>
    )
}

export default Delete
